import React from 'react';
import Modal from '../Modal';

const StreamDelete = () => {
	const actions = (
		<button
			type='button'
			className='btn btn-secondary'
			onClick={() => history.push('/')}>
			Cancel
		</button>
	);

	return (
		<div>
			StreamDelete
			<Modal
				title='Delete stream'
				content='Are you sure you want to delete this stream?'
			/>
		</div>
	);
};

export default StreamDelete;
